# -*- coding:utf-8 -*-

def hex2str(hex_stream):
    replaced = ['0x', 'L', ' ', '\\x', '\t', '\n', ',', ';', '.', ':', '%']
    for a in replaced:
        hex_stream = hex_stream.replace(a, '')
    num = hex_stream
    num = (len(num) % 2) * '0' + num
    ret = num.decode('hex')
    return ret

